INSERT INTO `recipe` VALUES (1,'Palomitas Caseras','Hoy aprenderemos a hacer unas deliciosas palomitas de maíz caseras. Un snack perfecto para compartir y disfrutar de una tarde de películas.e','<h2>INGREDIENTES</h2><ul><li>20 ml de aceite de oliva</li><li>200 g de granos de maíz para palomitas</li><li>Sal al gusto</li></ul><p><br></p><h2>INSTRUCCIONES</h2><ol><li>En una sartén honda ponemos 20 ml de aceite de oliva a fuego fuerte y esperamos que esté bien caliente pero que no llegue a humear.</li><li>Añadimos a la sartén 200 g de granos de maíz para hacer palomitas.</li><li>Cubrimos bien la superficie de la sartén con todos los granos. La sartén debe ser lo suficientemente grande como para que los granos queden en una sola capa.</li><li>Bajamos un poco el fuego y ponemos la tapa a la sartén. Es importante que la tapa tenga algún orificio que deje salir el vapor, de lo contrario los granos de maíz no se abrirán. Si la tapa no lo tuviese un orificio de escape de vapor, la levantaríamos un poco dejando un pequeño hueco que permita dejar salir el vapor. Esperaremos hasta que los granos de maíz hayan explotado y retiramos del fuego.</li><li>Ya fuera del fuego, añadimos la sal al gusto.</li><li>Servimos las palomitas de maíz caseras recién hechas, aunque aguantan perfectamente varios días sin nevera.</li></ol><p><br></p><p><br></p>',,'00:05:00',1,4,'user1',6);
INSERT INTO `recipe` VALUES (2,'Polenta Básica','Hacer una polenta básica es muy fácil y se necesitan solo tres ingredientes: sémola de maíz, agua y sal. Esta elaboración típica del norte de Italia.','<h2>INGREDIENTES</h2><ul><li>1 L de agua</li><li>1 pizca de sal</li><li>250 gramos de sémola de maíz</li></ul><p><br></p><p><br></p><h2>INSTRUCCIONES</h2><ol><li>Para hacer una polenta, tradicionalmente se empleaba una cazuela de cobre y se removía con un palo o una cuchara de madera, durante su cocción. Sin embargo, en esta receta vamos a preparar la polenta con un equipamiento básico en cualquier cocina. Ponemos 1 litro de agua en una olla y la acercamos al fuego.</li><li>Cuando el agua rompa a hervir, añadimos 1 pizca de sal y a continuación 250 g de sémola de maíz poco a poco y sin dejar de remover.</li><li>Una vez tenemos toda la sémola de maíz integrada y sin grumos, bajamos el fuego y dejamos que se vaya cociendo a fuego medio. La seguimos removiendo con frecuencia y la dejamos cocer durante unos 40 minutos, que es el tiempo que necesita la sémola de maíz para cocerse.</li><li>Una vez la sémola de maíz está completamente cocida, la apartamos del fuego y ya tenemos la polenta básica lista para servir de base a las elaboraciones deseadas. La podemos consumir así o como acompañamiento de guisos y otros platos. La servimos caliente para que se mantenga cremosa.</li><li>Otra opción es añadirle especias, quesos o leche y tener una polenta más cremosa. También se puede preparar más espesa, echarla en un molde y, una vez fría, cortarla y cocinarla a la plancha o frita.</li></ol><p><br></p>',,'00:45:00',1,4,'user1',1);
INSERT INTO `recipe` VALUES (3,'Crema de Elote','Dulce, sabrosa y única. Así podemos definir esta magnífica crema de elote. Si quieres sorprender en alguna ocasión a tus invitados con esta receta.','<h2><strong>INGREDIENTES PARA 4 PERSONAS</strong></h2><ul><li>75 g de mantequilla</li><li>1 cebolla</li><li>4 dientes de ajos</li><li>Sal</li><li>Pimienta negra molida</li><li>500 g de elote en lata o maíz dulce en lata</li><li>1 l de caldo de pollo</li><li>250 ml de nata para cocinar</li><li>Eneldo seco (para decorar)</li></ul><h2><br></h2><h2><strong>INSTRUCCIONES</strong></h2><ol><li>Para empezar, en una olla, ponemos los 75 g de mantequilla y cuando esta se haya derretido, introducimos 75 g de cebolla y 4 dientes de ajos picados. Salpimentamos al gusto.</li><li>A continuación, agregamos 500 g de elote o maíz dulce en lata y nos reservamos unos pocos granos para agregarlos a la crema al final de la receta. Si preferimos usar maíz fresco, tendríamos que cocer los granos previamente durante 40 minutos.</li><li>Vertemos a la olla 1 litro de caldo de pollo y dejamos hervir el conjunto durante 20 minutos a fuego medio.</li><li>Cuando haya pasado este tiempo, vertemos 250 ml de nata para cocina y mezclamos todo bien.</li><li>A continuación, trituramos muy bien toda la mezcla en una batidora, la colamos y la servimos. Echamos un poco de eneldo seco por encima para decorar y colocamos los granos de maíz que habíamos reservado anteriormente. ¡A disfrutar!</li></ol><h2><br></h2>',,'00:25:00',2,4,'user2',9),(4,'Pan de Elote','El pan de elote, o pan de maíz, es uno de los postres mexicanos típicos en todo este país. Es un bizcocho o pan dulce a base de maíz.','<h2><strong>INGREDIENTES PARA 6 PERSONAS</strong></h2><ul><li>100 g de mantequilla</li><li>250 g de granos de maíz fresco crudo</li><li>3 huevos</li><li>20 g de leche en polvo</li><li>50 g de azúcar</li><li>1 pizca de sal</li><li>1 cucharadita de canela</li><li>1 cucharadita de polvos de hornear (levadura química)</li><li>Azúcar glas para decorar</li></ul><h2><br></h2><p><br></p><h2>INSTRUCCIONES</h2><p>El secreto de este pan de elote está en usar los granos de maíz frescos y crudos, lo que hace que sea un pan de miga densa y húmeda. Dentro de las diferentes recetas y versiones que nos podemos encontrar del pan de elote, hay quien le añade harina de maíz o harina de trigo para conseguir una miga más esponjosa y aireada, aunque la receta tradicional no la lleva. En este receta, os contamos cómo hacer un&nbsp;<strong>pan de elote sin harina</strong>&nbsp;de ningún tipo, de manera sencilla y tradicional, solamente con granos de maíz.</p><ol><li>Pesamos los ingredientes de la receta y encendemos el horno a 190 ºC para que se vaya precalentando mientras preparamos la masa del pan de elote. Aparte, forramos un molde redondo de 18 cm de diámetro con papel de hornear y fundimos 100 g de mantequilla.</li><li>Ponemos 250 g de maíz y 3 huevos en un procesador o batidora y los trituramos hasta obtener una crema.</li><li>A continuación, añadimos 20 g de leche en polvo y 50 g de azúcar y volvemos a triturar el conjunto.</li><li>Finalmente, añadimos 1 pizca de sal, 1 cucharadita de canela, 1 cucharadita de polvos de hornear y, por último, incorporamos los 100 g de mantequilla fundida, que ya habrá enfriado un poco.</li><li>Batimos todo junto durante unos segundos y echamos la masa en el molde previamente forrado. Horneamos el pan de elote durante 45 minutos a 190 °C.</li><li>Como el tiempo de horneado puede variar en función de cada horno, para comprobar que el pan está completamente cocido, lo pinchamos con un palillo y, cuando este salga seco, retiramos el pastel del horno, lo desmoldamos y lo dejamos enfriar en una rejilla.</li><li>Una vez frío, espolvoreamos el pan de elote con azúcar glas y lo cortamos para servir en porciones</li></ol><p><br></p>',,'00:55:00',3,6,'user2',9),(5,'Humitas Ecuatorianas','Las humitas son una elaboración típica de Ecuador y otros países de Latinoamérica. Se suelen servir como desayuno, acompañadas de buen café.','<h2>INGREDIENTES PARA 12 PERSONAS</h2><ul><li>26 hojas secas de maíz</li><li>6 mazorcas de maíz</li><li>1 cebolla</li><li>2 dientes de ajo</li><li>300 g de queso mozzarella rallado</li><li>60 ml de nata líquida</li><li>2 huevos</li><li>1 cucharadita de sal</li><li>Salsa de ají de árbol (para servir)</li></ul><p><br></p><p><br></p><h2>INSTRUCCIONES</h2><ol><li>Llenamos un recipiente amplio y hondo con abundante agua caliente y ponemos 26 hojas secas de maíz a remojar unos minutos. El tiempo exacto dependerá de la temperatura del agua. Se hidratan más rápido con agua caliente, pero también quedan más frágiles.</li><li>Mientras las hojas de maíz se hidratan, preparamos la masa del relleno y comenzamos desgranando 6 mazorcas de maíz. Lo haremos colocándolas sobre una tabla de madera, en vertical, y cortando los laterales con un cuchillo afilado. Reservamos los troncos centrales de las mazorcas para la cocción.</li><li>Pelamos 1 cebolla y 2 dientes de ajo. Picamos la primera (no tiene que quedar perfecta) y rallamos los segundos.</li><li>Introducimos el maíz, la cebolla picada y los ajos rallados en el vaso de un robot de cocina junto con 150 gramos de queso mozzarella rallado (el resto del queso lo usaremos más adelante), 60 ml de nata líquida, 2 huevos y 1 cucharadita de sal.</li><li>Trituramos hasta obtener una masa homogénea, comenzando con una velocidad baja y aumentando la potencia poco a poco. Si no disponemos de un robot de cocina lo podemos hacer con una batidora de brazo.</li><li>Secamos las hojas de maíz y cortamos dos de ellas en tiras. Con el resto montamos las humitas, superponiendo las hojas de dos en dos por su parte más gruesa, tal y como se aprecia en las imágenes.</li><li>Colocamos tres cucharadas de la farsa o relleno en el centro de la hoja de maíz y cubrimos con un pellizco de los 150 gramos restantes de queso mozzarella rallado.</li><li>Para cerrar la humita doblamos primero el sobrante superior e inferior de las hojas de maíz, colocándolos sobre el relleno.</li><li>Después cerramos los extremos derecho e izquierdo, hacia el centro, y atamos el paquetito resultante con una tira de hoja de maíz o, en su defecto, con hilo de bramante (especial para cocinar).</li><li>Repetimos esta operación con el resto de hojas, hasta que no quede más relleno y tengamos 12 humitas.</li><li>Colocamos los troncos centrales de las mazorcas de maíz que hemos reservado en la base de una cacerola amplia. Colocamos las humitas encima, en una sola capa y tapamos la cazuela. Las cocemos al vapor durante 25-30 minutos a fuego medio-bajo. Podemos usar una vaporera en vez de los troncos de las mazorcas, pero con este truco ensuciamos un cacharro menos.</li><li>Transcurrido el tiempo de cocción, retiramos las humitas de la cazuela y las servimos inmediatamente, acompañadas de una taza de café y un poco de salsa de ají de árbol, como mandan las tradiciones.</li></ol><p><br></p>',,'01:29:00',3,12,'user3',7);
